<template>


  <div class="login-wrap" >
    <div style="margin-left: 78%">

      <el-button @click="toReception" >首页</el-button>
      <el-button @click="toMembers" >用户登录</el-button>

    </div>
    <el-form :model="ruleForm" label-width="100px" class="demo-ruleForm login-container">
      <h3 style="text-align: center;">管理员登录</h3>

      <el-form-item label="用户名">
        <el-input type="text" v-model="ruleForm.uname"></el-input>
      </el-form-item>
      <el-form-item label="密码">
        <el-input type="password" v-model="ruleForm.pwd"></el-input>
      </el-form-item>
      <el-form-item label="验证码">
        <el-input type="text" v-model="ruleForm.userCode"></el-input>
        <img id="img" :src="userCodeSrc" width="230px" height="60px" @click="changeCode" >
      </el-form-item>

      <el-form-item>
        <el-row>
          <el-col :span="24">
            <div class="grid-content bg-purple-dark">
              <el-button type="primary" style="width:100%;" @click="doLogin">提交</el-button>
              <!--<el-button type="primary" style="width:100%;" @click="selectone">测试</el-button>-->
            </div>
          </el-col>
        </el-row>
        <el-row>
          <el-col :span="12">
            <div class="grid-content bg-purple-dark">
              <el-link type="success">忘记密码</el-link>
            </div>
          </el-col>
        </el-row>
      </el-form-item>
    </el-form>
  </div>

</template>

<script>
  export default {
    data() {
      return {
        ruleForm: {
          uname: '',
          pwd: '',
          userCode:''
        },
        userCodeSrc:null
      };
    }
    ,
    created(){
      let url = this.axios.urls.SYSTEM_USER_VERIFICATION;

      this.axios.post(url,{}).then((response)=>{

        // console.log(response.data);
        this.userCodeSrc = response.data;
      }).catch(function(error){
        console.log(error);
      });
    }
    ,
    methods: {
      doLogin() {
        let url = this.axios.urls.SYSTEM_USER_DOLOGIN;
        console.log(url);

        this.axios.post(url, this.ruleForm).then((response)=> {
          console.log(response.data);
          if (response.data.code == 0) {
            this.$message({
              showClose: true,
              message: response.data.msg,
              type: 'success'
            });
            let user = response.data.data;


            this.$store.commit('setUserManage',{
              userManage:user
            })


            this.$router.push({path:'/ManageMent'})

          } else {
            this.$message({
              showClose: true,
              message: response.data.msg,
              type: 'error'
            });
          }

        }).catch(function(error) {
          console.log(error);
        });
      }
      ,
      changeCode(){
        let url = this.axios.urls.SYSTEM_USER_VERIFICATION;

        this.axios.post(url,{}).then((response)=>{
          // console.log(response.data);
          this.userCodeSrc = response.data;
        }).catch(function(error){
          console.log(error);
        });
      }
      ,
      toReception(){
        //用户跳转首页
        this.$router.push({path:'/'})
      },
      toMembers(){
        //用户跳转管理员登录
        this.$router.push({path:'/ReceptionLogin'})
      }
      // ,
      // selectone(){
      //   let url = this.axios.urls.SYSTEM_USER_SELECTONE;
      //   // console.log(url+","+window.vm.$store.getters.getJwt+",get"+window.vm.$store.getters.getVerificationJwt);
      //
      //   this.axios.post(url,{id:1}).then((response)=>{
      //     console.log("整个："+response.data);
      //     console.log(response.data);
      //
      //   }).catch(function(error){
      //     console.log(error);
      //   });
      // }



    }

  }
</script>

